window.bookSummaryJSON = "<p><b>\"A riveting tale of intrigue and terrorism, Key West characters in their full glory! Fast paced and continually changing direction Mr Becker has me hooked on his skillful and adventurous tales from the Conch Republic!\" </b></p> <p>It’s easy to become invisible in the Florida Keys. Mac Travis was doing his best to keep a low profile: diving, fishing and enough salvage work to pay his bills. It’s a good life until he discovers something while spearfishing that could change the pristine Keys forever. His drunken crewman soon lets out the secret and his life is instantly changed. </p> <p>A corrupt presidential candidate will do whatever it takes to hide his secret. An exiled coke dealing terrorist sees this as his opportunity to redeem himself. A local con man loyal only to himself is looking for a quick payoff. </p> <p>When Mac’s friend and mentor is injured, his estranged daughter reluctantly comes to his aid. The two soon put aside their differences and join forces to bury the secret where it won’t be found. </p>"; 
